smw-admin-supplementary-operational-tabl:
* <code>last_id</code> – zadnji ID, ki je trenutno v uporabi;
* <code>duplicate_count</code> – število dvojnikov, najdenih v tabeli id_table (glejte tudi [[Special:SemanticMediaWiki/duplicate-lookup|Iskanje podvojenih entitet]]);
* <code>rows.rev_count</code> – število vrstic, ki imajo dodeljen revision_id, ki označuje neposredno povezavo do vikistrani;
* <code>rows.smw_namespace_group_by_count</code> – število združenih vrstic za imenske prostore, uporabljene v tabeli;
* <code>rows.smw_proptable_hash.query_match_count</code> – število podobjektov poizvedbe z ustreznim sklicem na tabelo;
* <code>rows.smw_proptable_hash.query_null_count</code> – število podobjektov poizvedbe brez sklica na tabelo (nepovezan, plavajoč sklic).

* <code>unique_terms_occurrence_in_percent</code> – odstotek izrazov, ki so edinstveni (nizka odstotna stopnja pomeni, da vsebino in indeks tabel zapolnjujejo ponavljajoči se izrazi);
* <code>rows.terms_occurrence.single_occurrence_total_count</code> – število izrazov, ki se pojavijo samo enkrat;
* <code>rows.terms_occurrence.multi_occurrence_total_count</code> – število izrazov, ki se pojavijo večkrat.

