smw-search-help-input-assistance:
Za vnosno polje je na voljo [https://www.semantic-mediawiki.org/wiki/Help:Input_assistance pomoč pri vnosu], ki zahteva uporabo ene od naslednjih predpon:

* <code>p:</code> za omogočenje predlogov lastnosti (npr. <nowiki><code>[[p:Has ...</code></nowiki>);

* <code>c:</code> za omogočenje predlogov kategorij;

* <code>con:</code> za omogočenje predlogov pojmov.
